// SPDX-License-Identifier: MIT
pragma solidity ^0.5.16;

contract VehicleData {
    uint public vehicleCount = 0;
    string public status = "normal";

    struct Vehicle {
        uint id;
        address publicKey;
        string color;
        string model;
        uint passengerCapacity;
        uint distanceCovered;
        string location;
    }

    mapping(uint => Vehicle) public vehicles;

    event VehicleRegistered(
        uint id,
        address publicKey,
        string color,
        string model,
        uint passengerCapacity,
        uint distanceCovered,
        string location
    );

    event VehicleDetailsChanged(
        uint id,
        string color,
        string model,
        uint passengerCapacity,
        uint distanceCovered,
        string location
    );

    event Status(string status);

    constructor() public {
    }

    function recover(bytes32 hash, bytes memory signature) private pure returns (address) {
        bytes32 r;
        bytes32 s;
        uint8 v;

        // Check the signature length
        if (signature.length != 65) {
            return (address(0));
        }

        // Divide the signature in r, s and v variables
        // ecrecover takes the signature parameters, and the only way to get them
        // currently is to use assembly.
        // solium-disable-next-line security/no-inline-assembly
        assembly {
            r := mload(add(signature, 0x20))
            s := mload(add(signature, 0x40))
            v := byte(0, mload(add(signature, 0x60)))
        }

        // Version of signature should be 27 or 28, but 0 and 1 are also possible versions
        if (v < 27) {
            v += 27;
        }

        // If the version is correct return the signer address
        if (v != 27 && v != 28) {
            return (address(0));
        } else {
            // solium-disable-next-line arg-overflow
            return ecrecover(hash, v, r, s);
        }
    }

    function registerVehicle(
        address _publicKey, 
        string memory _color, 
        string memory _model, 
        uint _passengerCapacity, 
        uint _distanceCovered, 
        string memory _location,  
        bytes32 hash, 
        bytes memory signature
        ) public {
        address _signer = recover(hash, signature);
        require(_signer == _publicKey);
        vehicleCount++;
        vehicles[vehicleCount] = Vehicle(vehicleCount, _publicKey, _color, _model, _passengerCapacity, _distanceCovered, _location);
        emit VehicleRegistered(vehicleCount,  _publicKey, _color, _model, _passengerCapacity, _distanceCovered, _location);
    }

    function editVehicle(
        uint _id, 
        string memory _color, 
        string memory _model, 
        uint _passengerCapacity, 
        uint _distanceCovered, 
        string memory _location,  
        bytes32 hash, 
        bytes memory signature
        ) public {
        address _signer = recover(hash, signature);
        require(_signer == vehicles[_id].publicKey);
        Vehicle memory _vehicle = vehicles[_id];
        _vehicle.color = _color;
        _vehicle.model = _model;
        _vehicle.passengerCapacity = _passengerCapacity;
        _vehicle.distanceCovered = _distanceCovered;
        _vehicle.location = _location;
        vehicles[_id] = _vehicle; 
        emit VehicleDetailsChanged(_id, _color, _model, _passengerCapacity, _distanceCovered, _location);
    }

    function changeStatus(string memory _status, bytes32 hash, bytes memory signature, uint _id) public {
        address _signer = recover(hash, signature);
        require(_signer == vehicles[_id].publicKey);
        status = _status;
        emit Status(_status);
    }
}

